import {
    makeStyles
} from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    root: {
        position: 'fixed',

    },
    container:{
        width:"100%",
        backgroundColor:"red",
    },
    item:{
        backgroundColor:"#014034",
        textAlign:"center",
        color:"white",
        marginLeft:"auto",
        marginRight:"auto",
        height:"60px",
    },

}));

export default useStyles;
